import { StyleSheet, Text, View } from "react-native";
import React from "react";

const Privacy = ({ navigation }) => {
  return (
    <View>
      <Text>Privacy</Text>
    </View>
  );
};

export default Privacy;

const styles = StyleSheet.create({});
